owl:Class.rdfs:comment:
Подробное описание события, создаваемого конечным устройством. Значения в атрибутах позволяют создавать рекомендуемые коды, которые будут использоваться для идентификации событий конечных устройств следующим образом:
type;
domain;
subDomain;
eventOrAction .

owl:ObjectProperty.rdfs:comment:
Этап устранения. Наименование этапа (стадии):
- Новый;
- Назначен;
- В работе;
- Отложен;
- Отложен до ППР;
- Отклонен;
- Устранен;
- Закрыт;
- Отменен.

owl:DatatypeProperty.rdfs:comment:
Метод создания  записи об оконечном устройстве. Возможные значения:
ПУ создан в ПК Баласны по заявке, полученной в рамках сценария Техприс (ПУ был создан вместе с точкой поставки в рамках БП Технологическое присоединение);

ПУ создан самостоятельно в ПК Балансы.
